import './App.css';
import LandingView from './pages/landing.view/landing.view';

function App() {
  return (
    <div className="App">
       <Router>
      <div>

        <Switch>
          <Route path="/about">
            <About />
          </Route>
          <Route path="/users">
            <Users />
          </Route>
          <Route path="/">
            <Home />
          </Route>
        </Switch>
      </div>
    </Router>
    </div>
  );
}

export default App;
